from aiogram import types, Routerfrom aiogram.filters import Commandfrom telegram_bot.keyboards import get_custom_keyboardcommand_router = Router()@command_router.message(Command(commands=["start"]))async def start(message: types.Message):    await message.answer(f"Привіт, {message.from_user.username}!✋:")    await message.answer(f"Тисни на кнопку  ⬇️ ⬇️ ⬇️", reply_markup=get_custom_keyboard())@command_router.message(Command(commands=["help"]))async def start(message: types.Message):    await message.answer(f"Я постійно вдоскналююсь, віправляю баги та додаю у функціоналі.\n"                         f"перед початком роботи, перезапусти командою start")    await message.answer(f"Тисни на кнопку  ⬇️ ⬇️ ⬇️", reply_markup=get_custom_keyboard())# @comand_router.message(Command(commands=["contacts"]))# async def start(message: types.Message):#     await message.answer("Контакти видсутні")### @comand_router.message(commands=['proposal'])# async def proposal_command(message: types.Message):#     await message.reply("Залиш своє повідомлення тут")### @comand_router.message(commands=['feedback'])# async def feedback_command(message: types.Message):#     feedback_text = message.get_args()#     if feedback_text:#         await comand_router.message(chat_id=204071671,#                                     text=f"Feedback from {message.from_user.full_name} (@{message.from_user.username}):\n\n{feedback_text}")#         await message.reply("Thank you for your feedback! It has been forwarded to the admin.")#     else:#         await message.reply("Please provide your feedback after the command, like this: /feedback Your message here")